import { combineReducers } from "redux";
import postReducer from "./reducer/app";
import commentReducer from "./reducer/app";
import userReducer from "./reducer/app";

const reducers = combineReducers({
  post: postReducer,
  comment: commentReducer,
  user: userReducer,
});

export default reducers;
